import React from 'react';
import { Link } from 'react-router-dom';

export default function MainPage() {
    return (
        <footer>
            <ul>
                <li>©Solidarité Aulnay 2020</li>
                <li>CGV</li>
                <Link to="/contact" >
                    <li>Nous contacter</li>
                </Link>
                <li>Se connecter</li>
            </ul>
        </footer>
    )
}
